import Movies from './data/Movies';
import './App.css';

function App() {
  return (
    <div className="App">
     <section>
     {Movies.map((elt, i) =>
          <CarItem

            car={elt.name}
            model={elt.model}
            year={elt.year}
            color={elt.color}
          />
        )}
     </section>
    </div>
  );
}

export default App;
